import React from "react";
import Layout from "../layout/Layout";
import Button from '@material-ui/core/Button';

const Main = props => {

  const index = 0;

  return (

      <Layout>
          <div>
              SMILE
          </div>

          <Button size="medium" color="default"> Member </Button>
          <Button size="medium"> Register </Button>
      </Layout>

  );
};

export default Main;
